import React, { Component } from 'react';

class Home extends Component {
  constructor(props) {
    super(props)
    this.state = {
      user: {}
    }
    // BINDING GOES HERE
  }

  render() {
    return(
      <div className='home'>
        <h2> Home </h2>
        <p>
          Logged in as { this.state.user.email }
        </p>
      </div>
    )
  }
}

export default Home;
